//SPDX-License-Identifier: UNLICENSED

import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

pragma solidity ^0.8.10;

interface Burner {
    function burnTokens(address token, uint256 amount) external returns (bool);
}

contract Minting is Ownable, ERC721, IERC721Receiver {

    struct Config {
        bool active;
        uint256 tokenFactor;
        uint256 signatureBonusMultiplier;
    }

    struct MintingPartner {
        bool active;
        uint256 bonusFactor;
        address signer;
        string name;
        string description;
    }

    struct MintingNFT {
        bool active;
        uint32 start;
        uint32 end;
        uint32 lastClaim;
        uint256 amount;
        uint256 payoutFactor;
        address minter;
    }

    bool private active;

    modifier isActive {
        require(active == true, "Minting contract is not active");
        _;
    }

    IERC20 public token;
    Burner public burnContract;

    uint256 public totalNFTs;
    uint256 public remainingPayout;
    uint256 public remainingBurn;
    uint256 public burnPool;
    uint256 public burnFraction;
    uint256 public burnShare;

    mapping(address => MintingPartner) public stakingPartners;
    mapping(uint8 => Config) public configurations;
    mapping(uint256 => MintingNFT) public stakingNFTs;

    event Stake(uint8 yearsCount, address indexed sender, uint256 amount, uint256 payoutFactor, uint256 start, uint256 end, uint256 nftId);
    event Claim(address indexed sender, uint256 amount, uint256 claimTime, uint256 nftId);
    event Burn(address indexed sender, uint256 amount);

    constructor(address _token, address _burnContract)
    ERC721("Minting NFT", "NFT") {
        active = true;

        token = IERC20(_token);
        burnContract = Burner(_burnContract);

        _safeMint(msg.sender, 0);

        totalNFTs = 1;
        remainingPayout = 0;
        remainingBurn = 0;
        burnPool = 0;
        burnFraction = 0;
        burnShare = 0;
    }

    receive() external payable {
        revert("Native deposit not supported");
    }

    function toggleActive()
    public
    onlyOwner
    returns (bool) {
        active = !active;
        return active;
    }

    function setMintingPartner(
        address _signer,
        bool _active,
        string memory _name,
        string memory _description,
        uint256 _bonusFactor
    )
    public
    onlyOwner {
        require(_signer != address(0), "Can not set a configuration with signer address 0");
        stakingPartners[_signer] = MintingPartner(_active, _bonusFactor, _signer, _name, _description);
    }

    function setConfig(
        uint8 _yearsCount,
        bool _active,
        uint256 _tokenFactor,
        uint256 _signatureBonusMultiplier
    )
    public
    onlyOwner {
        require(_yearsCount > 0, "Can not set a configuration with 0 years");
        configurations[_yearsCount] = Config(_active, _tokenFactor, _signatureBonusMultiplier);
    }

    function setBurnFraction(uint256 _burnFraction)
    public
    onlyOwner {
        require(_burnFraction <= 1e18, "Burn fraction must not be greater than 1e18");
        burnFraction = _burnFraction;
    }

    function setBurnShare(uint256 _burnShare)
    public
    onlyOwner {
        require(_burnShare <= 1e18, "Burn share must not be greater than 1e18");
        burnShare = _burnShare;
    }

    function setBurnContract(address _burnContract)
    public
    onlyOwner {
        burnContract = Burner(_burnContract);
    }

    function stake(uint8 _stakingYears, uint256 _amount, bytes[] memory _signatures)
    external
    isActive
    returns (bool) {
        require(configurations[_stakingYears].active, "Cannot stake for given years");
        require(_amount > 0, "Amount needs to be greater than 0");
        require(token.allowance(msg.sender, address(this)) >= _amount, "Set token allowance first");

        uint256 signerFactor = 0;
        if (_signatures.length > 0) {
            address[] memory activePartners = new address[](_signatures.length);

            bytes32 addressHash = ECDSA.toEthSignedMessageHash(abi.encodePacked(msg.sender));
            for (uint i = 0; i < _signatures.length; i++) {
                address recoveredSigner = ECDSA.recover(addressHash, _signatures[i]);

                MintingPartner storage partner = stakingPartners[recoveredSigner];
                require(partner.signer == recoveredSigner, "Signature is invalid");
                require(partner.active, "Minting partner is not active");

                for (uint j = 0; j < i; j++) {
                    require(activePartners[j] != recoveredSigner, "Cannot use partner multiple times");
                }
                activePartners[i] = recoveredSigner;
                signerFactor += partner.bonusFactor;
            }
        }

        bool successTx = token.transferFrom(msg.sender, address(this), _amount);
        require(successTx, "Transfer failed");

        _stake(_stakingYears, _amount, signerFactor);

        return true;
    }

    function _stake(
        uint8 _years,
        uint256 _amount,
        uint256 _signerFactor
    ) internal {
        Config storage c = configurations[_years];

        uint256 duration = _years * 365 days;

        uint256 start = block.timestamp;
        uint256 end = start + duration;
        uint256 lastClaim = start;

        uint256 bonusFactor = (c.tokenFactor + _signerFactor * c.signatureBonusMultiplier / 1e18) * _years;
        uint256 payoutFactor = 1e18 + bonusFactor;

        stakingNFTs[totalNFTs] = MintingNFT(true, uint32(start), uint32(end), uint32(lastClaim), _amount, payoutFactor, msg.sender);
        _safeMint(msg.sender, totalNFTs);

        totalNFTs++;
        uint256 payout = _amount * payoutFactor / 1e18;
        remainingPayout += payout;
        remainingBurn += payout * burnFraction / 1e18;

        uint256 balance = token.balanceOf(address(this));
        require(balance > (remainingPayout + remainingBurn), "Not enough tokens in contract");

        emit Stake(_years, msg.sender, _amount, payoutFactor, start, end, totalNFTs - 1);
    }

    function claim(uint256[] memory _nftIds)
    public
    returns (bool) {
        require(_nftIds.length > 0, "Passed no NFT-IDs");
        uint256 payout = 0;

        for (uint i = 0; i < _nftIds.length; i++) {
            payout += _claim(msg.sender, _nftIds[i]);
        }

        require(payout > 0, "Claimed no payout sum");

        _safeTransfer(msg.sender, payout);
        return true;
    }

    function _claim(address _sender, uint256 _nftId)
    internal
    returns (uint256){
        require(ownerOf(_nftId) == _sender, "You don't own the NFT");

        MintingNFT storage nft = stakingNFTs[_nftId];
        require(nft.active, "NFT is not active");
        require(nft.lastClaim < nft.end, "NFT is completely claimed");

        uint256 claimTime = uint32(block.timestamp);
        if (claimTime > nft.end)
            claimTime = nft.end;

        uint256 duration = nft.end - nft.start;
        uint256 claimAmount = nft.amount * (claimTime - nft.lastClaim) * nft.payoutFactor / duration / 1e18;
        uint256 burnAmount = claimAmount * burnFraction / 1e18;

        nft.lastClaim = uint32(claimTime);

        remainingPayout -= claimAmount;

        emit Claim(_sender, claimAmount, claimTime, _nftId);

        burnPool += burnAmount;

        require(claimAmount > 0, "Claimed no payout");
        return claimAmount;
    }

    function burnTokens()
    public
    returns (bool) {
        require(address(burnContract) != address(0), "No burn contract specified");

        uint256 reward = burnPool * burnShare / 1e18;
        uint256 burnAmount = burnPool - reward;

        remainingBurn -= burnPool;
        burnPool = 0;

        _safeTransfer(address(burnContract), burnAmount);

        bool burnSuccess = burnContract.burnTokens(address(token), burnAmount);
        require(burnSuccess == true, "Token burning was not successful");

        _safeTransfer(msg.sender, reward);

        emit Burn(msg.sender, burnAmount);
        return true;
    }

    function _safeTransfer(address _to, uint256 _amount)
    internal {
        bool success = token.transfer(_to, _amount);
        require(success == true, "Transfer failed");
    }

    function rescueTokens(address _token)
    public
    onlyOwner {
        require(_token != address(0), "Token address can not be 0");

        IERC20 transferToken = IERC20(_token);
        uint256 amount = transferToken.balanceOf(address(this));

        if (transferToken == token) {
            amount -= (remainingPayout + remainingBurn);
        }

        require(amount > 0, "Not enough funds to transfer");

        bool success = transferToken.transfer(msg.sender, amount);
        require(success == true, "Transfer failed");
    }

    function onERC721Received(address _operator, address _from, uint256 _tokenId, bytes memory _data)
    external
    returns (bytes4 value) {
        revert('Can not receive ERC721 tokens');
    }
}
